import React from 'react'

export default function SearchResults(props) {
  const data = props.data;
  return (
    <div>
        {data.map((data, index) => {
          return (
            <div className="results">
              <ul>
                <li>{data.original_title}</li>
                <li>{data.vote_average}s</li>
                <li>{data.release_date.slice(0, 4)}</li>
              </ul>
            </div>
          )
        })};
    </div>
  )
}
